// SPDX-License-Identifier: GPL-3.0

//pragma solidity >= 0.7.0 < 0.8.1;
pragma solidity ^0.8.0;

contract Identity
{
    uint8 count = 255; 
    function getCount() public view returns(uint8) {
        return count+1;
    }

    function bitwiseLeftShift(uint256 value, uint256 shift) public pure returns (uint256) {
        return value << shift;
    }

    // Arithmetic left shift (using multiplication)
    function arithmeticLeftShift(uint256 value, uint256 shift) public pure returns (uint256) {
        return value * (2**shift);
    }
}

